        outerPadding:"pb-2 pt-3",  
        bgColor:"bg-grey-d7",
        fontTheme:"light-background",
        ariaLabel:"Social share Links",
        socialShare:{
            headline:"Share this page",
            facebook:{
                ariaLabel:"Share this page on Facebook",
                dataInfo:"FaceBook",
